syntax = "proto3";

option go_package = "github.com/leeavital/protoc-gen-gostreamer/example/pb";

package foo.bar;


message Thing2 {
  int64 z = 2;
  int32 myThirtyTwo = 5;
}

message Thing {
  int64 x = 1;
  int64 y = 2;
  repeated Thing2 things = 3;
  repeated string myname = 4;

  message SubMessage {
    int64 x = 1;
  }
  SubMessage s = 5;
}
